type Variant = "v1" | "v2" | "v4" | "v4.5" | "v9";

type WrapperProps = {
  accentColor: AccentColor;
  sx?: SxProps;
  color?: string;
};

const Wrapper: React.FC<React.PropsWithChildren<WrapperProps>> = ({
  children,
  accentColor,
  sx = {},
  color,
}) => {
  const accent = accentColorBase[accentColor];
  return (
    <Box
      sx={{
        "& path": {
          stroke: color ?? accent.overlayFill,
        },
        ...sx,
      }}
    >
      {children}
    </Box>
  );
};

export type SectionContainerOverlayProps = {
  variant: Variant;
  accentColor: AccentColor;
  color?: string;
};

export const SectionContainerOverlay: React.FC<SectionContainerOverlayProps> =
  withCustomTheme(({ variant, accentColor, color }) => {
    if (variant === "v1") {
      return (
        <Wrapper
          accentColor={accentColor}
          sx={{
            position: "absolute",
            top: "50%",
            left: "0",
            transform: "translateY(-50%)",
            minWidth: "100vw",
          }}
        >
          <Overlay1 />
        </Wrapper>
      );
    }
    if (variant === "v2") {
      return (
        <Wrapper
          accentColor={accentColor}
          sx={{
            position: "absolute",
            top: "0",
            left: "50%",
            transform: "translateX(-50%)",
          }}
        >
          <Overlay2 />
        </Wrapper>
      );
    }

    if (variant === "v4") {
      return (
        <Wrapper
          color={color}
          accentColor={accentColor}
          sx={{
            position: "absolute",
            top: { xs: "0", sm: "55%" },
            transform: "translateY(-50%)",
            right: "-68px",
          }}
        >
          <Overlay4 />
        </Wrapper>
      );
    }

    if (variant === "v4.5") {
      return (
        <Wrapper
          color={color}
          accentColor={accentColor}
          sx={{
            position: "absolute",
            top: { xs: "0", sm: "55%" },
            transform: { xs: "translateY(-26%)", sm: "translateY(-50%)" },
            right: "-68px",
          }}
        >
          <Overlay4 />
        </Wrapper>
      );
    }

    if (variant === "v9") {
      return (
        <Wrapper
          accentColor={accentColor}
          sx={{
            position: "absolute",
            top: "0",
            height: { xs: "100%", sm: "100%" },
            width: { xs: undefined, sm: "100%" },
            "& svg": {
              height: { xs: "100%", sm: "inherit" },
              width: { xs: undefined, sm: "100%" },
            },
          }}
          color="rgba(255, 255, 255, 0.3)"
        >
          <Overlay5 />
        </Wrapper>
      );
    }

    return null;
  });
